script: |
  super -f tsv -I q3296.sql | sort > q3296.out

vector: true

inputs:
  - name: q3296.sql
    data: |
      SELECT b,
      abs(b-c),
      d
      FROM t1
      WHERE d NOT BETWEEN 110 AND 150
      AND (e>a AND e<b);
  - name: t1

outputs:
  - name: q3296.out
    data: |
      194	1	190
      223	1	222
      249	2	248
